import React from 'react';
import "./Background.css";

export default class Background extends React.Component {

  render() {
    return (
      <div>
        <div className="bg"> </div>
        <div className="bg2"> </div>
        <div className="bg3"> </div>
        <div className="bg4"> </div>
      </div>
    );
  }
}
